import React from 'react';
import {Tab, Tabs} from '@material-ui/core';

function LinkTab(props) {
  return (
    <Tab
      component="a"
      onClick={(event) => {
        event.preventDefault();
      }}
      {...props}
    />
  );
}

function HeaderForms() {
  return (
    <header>
      <h1 class="title">Team Sign Up</h1>
      <Tabs aria-label="nav tabs example">
        <LinkTab label="Basic" href="/TelaUm" />
        <LinkTab label="Social" href="/TelaDois" />
        <LinkTab label="Certificates" href="/TelaTres" />
      </Tabs>
    </header>
  );
}

export default HeaderForms;
